import {BrowserRouter as Router, Switch, Route} from 'react-router-dom';
import Welcoming from '../src/components/welcoming/welcomingHomePage';
/*import Trainee from '../src/components/trainee/opportunity';
import Company from'../src/components/company/appliedTrainee';*/
import SignIn from'../src/components/signIn-signUp/signIn';

const App = () => {
  return (
   <Router>
   <div>
    <Switch>
    <Route path='/' exact component={Home} />
    <Route path='/SignUp' component={SignIn} />
    </Switch>
    </div>
   </Router>
  );
}

const Home =() =>(
  <div>
    <Welcoming />
  </div>
);
export default App;
